INSERT INTO `v1_449d734fc18bdfefe680abe16553c80e1c42be1545df2796ca2925c107746e76` VALUES (0, 0.0, "あたしだって\nやるときはやるよ！", 0.0, 24, 1, 10040, "2030/12/17 14:59:59", 24001, 1, 102601, 0.0, "2020/04/30 12:00:00", "リン");
INSERT INTO `v1_449d734fc18bdfefe680abe16553c80e1c42be1545df2796ca2925c107746e76` VALUES (1, 0.0, "ふぅ…\nこれであたしの仕事は\n終わりだね", 0.0, 24, 1, 10040, "2030/12/17 14:59:59", 24002, 1, 102601, 0.0, "2020/04/30 12:00:00", "リン");
INSERT INTO `v1_449d734fc18bdfefe680abe16553c80e1c42be1545df2796ca2925c107746e76` VALUES (2, 0.0, "終わった終わった\n一人でもなんとか\nなるもんだね", 0.0, 24, 1, 10040, "2030/12/17 14:59:59", 24003, 1, 102601, 0.0, "2020/04/30 12:00:00", "リン");
INSERT INTO `v1_449d734fc18bdfefe680abe16553c80e1c42be1545df2796ca2925c107746e76` VALUES (3, 0.0, "やったね！\nこれでようやく\nサボれるよ…", 0.0, 24, 2, 10040, "2030/12/17 14:59:59", 24004, 2, 102601, 0.0, "2020/04/30 12:00:00", "リン");
INSERT INTO `v1_449d734fc18bdfefe680abe16553c80e1c42be1545df2796ca2925c107746e76` VALUES (4, 0.0, "チーズが欲しいなら\nきちんと働いて\n買いに来なよ", 0.0, 24, 1, 10040, "2030/12/17 14:59:59", 24005, 1, 102601, 0.0, "2020/04/30 12:00:00", "リン");
INSERT INTO `v1_449d734fc18bdfefe680abe16553c80e1c42be1545df2796ca2925c107746e76` VALUES (5, 0.0, "あたしを敵に回した\n恐ろしさ\n思い知ったか！", 0.0, 24, 2, 10040, "2030/12/17 14:59:59", 24006, 2, 102601, 0.0, "2020/04/30 12:00:00", "リン");
INSERT INTO `v1_449d734fc18bdfefe680abe16553c80e1c42be1545df2796ca2925c107746e76` VALUES (6, 0.0, "あたしも意外と\nやるもんでしょ？", 0.0, 24, 2, 10040, "2030/12/17 14:59:59", 24007, 2, 102601, 0.0, "2020/04/30 12:00:00", "リン");
INSERT INTO `v1_449d734fc18bdfefe680abe16553c80e1c42be1545df2796ca2925c107746e76` VALUES (7, 0.0, "疲れた…\nねずみの逃げ足\n速すぎるよ…", 0.0, 24, 4, 10040, "2030/12/17 14:59:59", 24008, 4, 102601, 0.0, "2020/04/30 12:00:00", "リン");
INSERT INTO `v1_449d734fc18bdfefe680abe16553c80e1c42be1545df2796ca2925c107746e76` VALUES (8, 0.0, "このままじゃ\nまっひ～に\n叱られちゃうよ", 0.0, 24, 4, 10040, "2030/12/17 14:59:59", 24009, 4, 102601, 0.0, "2020/04/30 12:00:00", "リン");
INSERT INTO `v1_449d734fc18bdfefe680abe16553c80e1c42be1545df2796ca2925c107746e76` VALUES (9, 0.0, "まじめに\nやったんだけどな…\n悔しいな～", 0.0, 24, 4, 10040, "2030/12/17 14:59:59", 24010, 4, 102601, 0.0, "2020/04/30 12:00:00", "リン");
INSERT INTO `v1_449d734fc18bdfefe680abe16553c80e1c42be1545df2796ca2925c107746e76` VALUES (10, 0.0, "やられた…\nねずみって意外と\nてごわいね", 0.0, 24, 4, 10040, "2030/12/17 14:59:59", 24011, 4, 102601, 0.0, "2020/04/30 12:00:00", "リン");
INSERT INTO `v1_449d734fc18bdfefe680abe16553c80e1c42be1545df2796ca2925c107746e76` VALUES (11, 0.0, "おのれ～\nあたしのチーズを\n盗みやがって～！", 0.0, 24, 4, 10040, "2030/12/17 14:59:59", 24012, 4, 102601, 0.0, "2020/04/30 12:00:00", "リン");
INSERT INTO `v1_449d734fc18bdfefe680abe16553c80e1c42be1545df2796ca2925c107746e76` VALUES (12, 0.0, "疲れた…\nけど、次こそは\n守り抜くよ…", 1.81, 24, 1, 10040, "2030/12/17 14:59:59", 24013, 4, 102601, 0.0, "2020/04/30 12:00:00", "リン");
